import React from 'react';
import axios from 'axios';
import '../styles/containerdashdoard.css';
import { useState } from 'react';
import { getUser, getPassword } from "../helpers/Utils";

function ContainerDashBoard() {

    const [data, setData] = useState([]);

    axios({
        method: 'get',
        url: 'https://productifes-dispmoveisbsi.b4a.run/pegar_produtos.php',
        auth: {
            username: getUser(),
            password: getPassword()
        },
        headers: {'Content-Type': 'application/x-www-form-urlencoded'}
    }).then((response) => {
        if(response.status === 200) {
            if(response.data["sucesso"] === 1) {
                setCurrentItems(response.data["produtos"]);
                let qtde_produtos = response.data["qtde_produtos"];
                setItensCount(qtde_produtos);
                setPageCount( Math.floor(qtde_produtos, itensPerPage));
            }
            else {
                //var erro =  response.data["erro"];
                //window.alert("Erro ao obter lista de produtos: \n" . erro);
            }
        }
        else {
            window.alert("Erro ao obter lista de produtos: \n");
        }
    })

    return (
        <div className="dashboard-page">
            <div className="main-content">
                <Header />
                <DashboardContent />
            </div>
        </div>
    );
}

function NavLink({ label }) {
    if (label === "Register") return <a href="register">{label}</a>;
    return <a href="test">{label}</a>;
}

function Header() {
    return (
        <div className="header">
            <input
                type="text"
                className="search-bar"
                placeholder="Search resources..."
            />
            <div className="header-icons">
                <nav className="nav-links">
                    <NavLink label="Ships Dashboard"/>
                    <NavLink label="Ships Dashboard"/>  
                    <NavLink label="Ships Dashboard"/>  
                    <NavLink label="Ships Dashboard"/>  
                </nav>
                <button className="create-button">Create Container</button>
            </div>
        </div>
    );
}

function DashboardContent() {
    return (
        <div className="dashboard">
            <div className="dashboard-header">
                <h2>Container Dashboard</h2>
            </div>
            <div className="dashboard-content">
                <SummaryCard title="Container Location Summary" />
                <SummaryCard title="Container Type Summary" />
                <RightSidebar />
            </div>
        </div>
    );
}

function SummaryCard({ title }) {

    if(title==="Container Location Summary"){

    }

    return (
        <div className="summary-card">
            <h3>{title}</h3>
            <p>Some summary data here...</p>
        </div>
    );
}

function RightSidebar() {
    return (
        <div className="right-sidebar">
            <SmallCard title="Total Containers With Alerts" count="19" />
            <SmallCard title="Team Management" count="25" />
            <AdCard />
        </div>
    );
}

function SmallCard({ title, count }) {
    return (
        <div className="small-card">
            <h4>{title}</h4>
            <div className="card-content">
                <div className="card-count">{count}</div>
                <div className="view-all">View All</div>
            </div>
        </div>
    );
}

function AdCard() {
    return (
        <div className="ad-card">
            <h4>Containers Mapping</h4>
            <div className="learn-more">Learn More</div>
        </div>
    );
}

export default ContainerDashBoard;
